import { makeStyles } from "@material-ui/core/styles";

export default makeStyles((theme) => ({
  chip: {
    margin: "5px 5px 5px 0",
  },
  title: {
    fontFamily: "Mochiy Pop P One",
    fontSize: "175%",
  },
  subtitle: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
    marginTop: "10px",
  },
  spacing: {
    display: "flex",
    alignItems: "center",
    justifyContent: "space-between",
  },
  formControl: {
    margin: theme.spacing(2),
    minWidth: 250,
    marginBottom: "30px",
  },
}));
